// SPDX-License-Identifier: AFEL
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/utils/math/Math.sol";
import "./Coin.sol";
import "./OracleConsumer.sol";
import "./IOracle.sol";

contract Djed is OracleConsumer {
    Coin public stableCoin;
    Coin public reserveCoin;

    // Treasury Parameters:
    address public immutable treasury;           // address of the treasury 
    uint public immutable initialTreasuryFee;    // initial fee to fund the treasury
    uint public immutable treasuryRevenueTarget; // target revenue above which the treasury fee is set to 0
    uint public treasuryRevenue = 0;             // holds how much has already been paid to the treasury // Mutable state variable

    // Djed Parameters:
    uint public immutable reserveRatioMin;
    uint public immutable reserveRatioMax;
    uint public immutable fee;
    uint public immutable thresholdSupplySC;
    uint public immutable rcMinPrice;
    uint public immutable txLimit; 

    // Scaling factors:
    uint immutable scalingFactor; // used to represent a decimal number `d` as the uint number `d * scalingFactor`
    uint immutable scDecimalScalingFactor;
    uint immutable rcDecimalScalingFactor;

    event BoughtStableCoins(address indexed buyer, address indexed receiver, uint amountSC, uint amountBC);
    event SoldStableCoins(address indexed seller, address indexed receiver, uint amountSC, uint amountBC);
    event BoughtReserveCoins(address indexed buyer, address indexed receiver, uint amountRC, uint amountBC);
    event SoldReserveCoins(address indexed seller, address indexed receiver, uint amountRC, uint amountBC);
    event SoldBothCoins(address indexed seller, address indexed receiver, uint amountSC, uint amountRC, uint amountBC);

    constructor(
        address oracleAddress, uint _scalingFactor, address _treasury, uint _initialTreasuryFee, uint _treasuryRevenueTarget,
        uint _reserveRatioMin, uint _reserveRatioMax, uint _fee, uint _thresholdSupplySC, uint _rcMinPrice, uint _txLimit
    ) payable {
        stableCoin = new Coin("StableCoin", "SC");
        reserveCoin = new Coin("ReserveCoin", "RC");
        scDecimalScalingFactor = 10**stableCoin.decimals();
        rcDecimalScalingFactor = 10**reserveCoin.decimals();
        oracle = IOracle(oracleAddress);
        scalingFactor = _scalingFactor;

        treasury = _treasury;
        initialTreasuryFee = _initialTreasuryFee;
        treasuryRevenueTarget = _treasuryRevenueTarget;

        reserveRatioMin = _reserveRatioMin;
        reserveRatioMax = _reserveRatioMax;
        fee = _fee;
        thresholdSupplySC = _thresholdSupplySC;
        rcMinPrice = _rcMinPrice;
        txLimit = _txLimit;
    }

    // Reserve, Liabilities, Equity (in weis) and Reserve Ratio
    function R() internal view returns (uint) { return address(this).balance; }
    function L(uint _scPrice) internal view returns (uint) { return stableCoin.totalSupply() * _scPrice / scDecimalScalingFactor; }
    function E(uint _scPrice) internal view returns (uint) { return R() - L(_scPrice); }
    function ratio(uint _scPrice) internal view returns (uint) { return R()/L(_scPrice); }

    // # Public Trading Functions:

    function buyStableCoins(address receiver, uint fee_ui, address ui) external payable {
        uint amountBC = deductFees(msg.value, fee_ui, ui); // side-effect: increases `treasuryRevenue` and `oracleAvailableFunding`
        uint scP = scPrice();
        uint amountSC = (amountBC * scDecimalScalingFactor) / scP;
        require(amountSC <= txLimit || stableCoin.totalSupply() <= thresholdSupplySC, "buySC: tx limit exceeded");
        stableCoin.mint(receiver, amountSC);
        require(isRatioAboveMin(scP), "buySC: ratio below min");
        emit BoughtStableCoins(msg.sender, receiver, amountSC, msg.value);
    }

    function sellStableCoins(uint amountSC, address receiver, uint fee_ui, address ui) external {
        require(stableCoin.balanceOf(msg.sender) >= amountSC, "sellSC: insufficient SC balance");
        require(amountSC <= txLimit || stableCoin.totalSupply() <= thresholdSupplySC, "sellSC: tx limit exceeded");
        uint scP = scPrice();
        uint value = amountSC * scP / scDecimalScalingFactor;
        uint amountBC = deductFees(value, fee_ui, ui); // side-effect: increases `treasuryRevenue` and `oracleAvailableFunding`
        stableCoin.burn(msg.sender, amountSC);
        payable(receiver).transfer(amountBC);
        emit SoldStableCoins(msg.sender, receiver, amountSC, amountBC);
    }

    function buyReserveCoins(address receiver, uint fee_ui, address ui) external payable {
        uint scP = scPrice();
        require(msg.value <= txLimit  * scP / scDecimalScalingFactor || stableCoin.totalSupply() <= thresholdSupplySC, "buyRC: tx limit exceeded");
        uint amountBC = deductFees(msg.value, fee_ui, ui); // side-effect: increases `treasuryRevenue` and `oracleAvailableFunding`
        uint amountRC = (amountBC * rcDecimalScalingFactor) / rcBuyingPrice(scP);
        reserveCoin.mint(receiver, amountRC);
        require(isRatioBelowMax(scP) || stableCoin.totalSupply() <= thresholdSupplySC, "buyRC: ratio above max");
        emit BoughtReserveCoins(msg.sender, receiver, amountRC, msg.value);
    }   

    function sellReserveCoins(uint amountRC, address receiver, uint fee_ui, address ui) external {
        require(reserveCoin.balanceOf(msg.sender) >= amountRC, "sellRC: insufficient RC balance"); 
        uint scP = scPrice();
        uint value = amountRC * rcTargetPrice(scP) / rcDecimalScalingFactor;
        require(value <= txLimit * scP / scDecimalScalingFactor || stableCoin.totalSupply() <= thresholdSupplySC, "sellRC: tx limit exceeded");
        uint amountBC = deductFees(value, fee_ui, ui); // side-effect: increases `treasuryRevenue` and `oracleAvailableFunding`
        reserveCoin.burn(msg.sender, amountRC);
        payable(receiver).transfer(amountBC);
        require(isRatioAboveMin(scP), "sellRC: ratio below min");
        emit SoldReserveCoins(msg.sender, receiver, amountRC, amountBC);
    }

    function sellBothCoins(uint amountSC, uint amountRC, address receiver, uint fee_ui, address ui) external {
        require(stableCoin.balanceOf(msg.sender) >= amountSC, "sellBoth: insufficient SC balance"); 
        require(reserveCoin.balanceOf(msg.sender) >= amountRC, "sellBoth: insufficient RC balance");
        uint scP = scPrice();
        uint preRatio = ratio(scP);
        uint value = amountSC * scP / scDecimalScalingFactor +
                     amountRC * rcTargetPrice(scP) / rcDecimalScalingFactor;
        require(value <= txLimit * scP / scDecimalScalingFactor || stableCoin.totalSupply() <= thresholdSupplySC, "sellBoth: tx limit exceeded");
        stableCoin.burn(msg.sender, amountSC);
        reserveCoin.burn(msg.sender, amountRC);
        uint amountBC = deductFees(value, fee_ui, ui); // side-effect: increases `treasuryRevenue` and `oracleAvailableFunding`
        payable(receiver).transfer(amountBC);
        require(ratio(scP) >= preRatio, "sellBoth: reserve ratio decreased");
        emit SoldBothCoins(msg.sender, receiver, amountSC, amountRC, amountBC);
    }

    // # Auxiliary Functions

    function deductFees(uint value, uint fee_ui, address ui) internal returns (uint) {
        uint f = value * fee / scalingFactor;
        uint f_ui = value * fee_ui / scalingFactor;
        uint f_t = value * treasuryFee() / scalingFactor;
        // payable(address(this)).transfer(f); // this happens implicitly, and thus `f` is effectively transfered to the reserve.
        payable(ui).transfer(f_ui);
        payable(treasury).transfer(f_t); 
        treasuryRevenue += f_t;
        oracleAvailableFunding += f / 10; // one 10th of the fee paid to the reserve is made available to be used to fund the oracle.
        return value - f - f_ui - f_t; // amountBC
    }

    function isRatioAboveMin(uint _scPrice) internal view returns (bool) {
        return R() * scalingFactor * scDecimalScalingFactor > stableCoin.totalSupply() * _scPrice * reserveRatioMin;
    }

    function isRatioBelowMax(uint _scPrice) internal view returns (bool) {
        return R() * scalingFactor * scDecimalScalingFactor < stableCoin.totalSupply() * _scPrice * reserveRatioMax;
    }

    // Treasury Fee: starts as `initialTreasuryFee` and decreases linearly to 0 as the `treasuryRevenue` approaches the `treasuryRevenueTarget`
    function treasuryFee() public view returns (uint) {
        return (treasuryRevenue >= treasuryRevenueTarget) ? 0 : initialTreasuryFee - ((initialTreasuryFee * treasuryRevenue) / treasuryRevenueTarget);
    }

    // # Price Functions: return the price in weis for 1 whole coin.

    function scPrice() internal view returns (uint) {
        uint scTargetPrice = oracle.readData();
        uint sSC = stableCoin.totalSupply();
        return sSC == 0  ?  scTargetPrice  :  Math.min(scTargetPrice, (R() * scDecimalScalingFactor) / sSC);
    }

    function rcTargetPrice(uint _scPrice) internal view returns (uint) {
        uint sRC = reserveCoin.totalSupply();
        require(sRC != 0);
        return (E(_scPrice) * rcDecimalScalingFactor) / sRC;
    }

    function rcBuyingPrice(uint _scPrice) internal view returns (uint) {
        return reserveCoin.totalSupply() == 0  ?  rcMinPrice  :  Math.max(rcTargetPrice(_scPrice), rcMinPrice);
    }
}
